CREATE TABLE status (
	id INTEGER NOT NULL, 
	status INTEGER, 
	date_time VARCHAR(40), 
	product_id INTEGER, 
	station_id INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(product_id) REFERENCES product (id), 
	FOREIGN KEY(station_id) REFERENCES station (id)
);
CREATE TABLE station (
	id INTEGER NOT NULL, 
	ip VARCHAR(15), 
	port INTEGER, 
	rack INTEGER, 
	slot INTEGER, 
	PRIMARY KEY (id)
);
CREATE TABLE rework (
	id INTEGER NOT NULL, 
	product_id INTEGER, 
	station_id INTEGER, 
	operation_type_id INTEGER, 
	date_time VARCHAR(40), 
	description VARCHAR(1024), 
	PRIMARY KEY (id)
);
CREATE TABLE product (
	id INTEGER NOT NULL, 
	type INTEGER, 
	serial INTEGER, 
	week INTEGER, 
	year INTEGER, 
	PRIMARY KEY (id)
);
CREATE TABLE operation_type (
	id INTEGER NOT NULL, 
	name VARCHAR(50), 
	description VARCHAR(255), 
	PRIMARY KEY (id)
);
);
CREATE TABLE operation (
	id INTEGER NOT NULL, 
	product_id INTEGER, 
	station_id INTEGER, 
	operation_status INTEGER, 
	operation_type_id INTEGER, 
	date_time VARCHAR(40), 
	result_1 FLOAT, 
	result_1_max FLOAT, 
	result_1_min FLOAT, 
	result_1_status FLOAT, 
	result_2 FLOAT, 
	result_2_max FLOAT, 
	result_2_min FLOAT, 
	result_2_status FLOAT, 
	result_3 FLOAT, 
	result_3_max FLOAT, 
	result_3_min FLOAT, 
	result_3_status FLOAT, 
	PRIMARY KEY (id)
);
COMMIT;
